import React from "react";
import { Link, useNavigate } from "react-router-dom";
import Navbar from "./Navbar";
import { googleLogout } from "@react-oauth/google";
import Appraisal from "./Form/Appraisal";
import '../App.css'

function Common() {
  let history = useNavigate();

  const logout = () => {
    googleLogout({});
    history("/")
  };

  return (
    <div className="header">
      <div>
        <Link to="https://divum.in/" target="_blank">
          <img
            src="https://content.jdmagicbox.com/comp/bangalore/23/080p3033723/catalogue/divum-corportate-services-pvt-ltd-domlur-bangalore-computer-software-developers-0fdbsyb7ib-250.jpg"
            alt="divum-logo" 
            className="img-logo"
          />
        </Link>
      </div>
      <div className="nav">
        <Navbar />
      </div>
      <div>
        <button onClick={logout} className="logout">Log out</button>
      </div>
      <button onClick={history("/aprcl")}>Form</button>
    </div>
  );
}

export default Common;
